import React from 'react';

const subs = [
  { name: 'Hackathon Hub', desc: 'All hackathon events and info.' },
  { name: 'Tech News', desc: 'Latest updates and trends.' },
  { name: 'Learning Resources', desc: 'Curated learning materials.' },
  { name: 'Career Guidance', desc: 'Advice and job opportunities.' },
  { name: 'Networking', desc: 'Connect with peers.' }
];

const SubCommunities = () => (
  <section className="sub-communities">
    <h3>Sub-Communities</h3>
    <div className="subs-grid">
      {subs.map(sub => (
        <div className="sub-card" key={sub.name}>
          <h4>{sub.name}</h4>
          <p>{sub.desc}</p>
        </div>
      ))}
    </div>
  </section>
);

export default SubCommunities;
